import { useEffect, useState } from 'react';
import Select from './common/Select';
import { Sidebar, Menu, MenuItem, SubMenu } from 'react-pro-sidebar';
import { Link } from 'react-router-dom';
import './SideBar.css';

function SideBar(){
    return(
        // <div class="accordion" id="sideBarCours">
        //     <Select text='Mathématique' id="1" idParent="sideBarCours"/>
        //     <Select text='Français' id="2" idParent="sideBarCours"/>
        // </div>
        <div>
            <Sidebar className="custom-sidebar">
                <Menu menuItemStyles={{
                    button: ({ level, active, disabled }) => {
                        // only apply styles on first level elements of the tree
                        if (level === 0) {
                            return {
                                color: disabled ? '#white' : 'white',
                                backgroundColor: active ? '#eecef9' : '#181C20',
                            };
                        }
                            
                    },
                }}>
                    <SubMenu label="Mathématique">
                        <MenuItem component={<Link to="" />}> Pie charts </MenuItem>
                        <MenuItem> Line charts </MenuItem>
                    </SubMenu>
                    <SubMenu label="Français">
                        <MenuItem> Pie charts </MenuItem>
                        <MenuItem> Line charts </MenuItem>
                    </SubMenu>
                    <SubMenu label="Sciences">
                        <MenuItem> Pie charts </MenuItem>
                        <MenuItem> Line charts </MenuItem>
                    </SubMenu>
                </Menu>
            </Sidebar>
        </div>
        
    )
}

export default SideBar;
